"ko": |-
  - 여러 부분은 괄호 중첩으로 표시됩니다.  괄호로 묶인 목록의 첫 번째 요소인 신체 유형 대신 하나 이상의 중첩된 신체 구조의 시퀀스가 ​​있습니다.  괄호 안에 있는 목록의 두 번째 요소는 다중 부분 하위 유형(혼합, 다이제스트, 병렬, 대체 등)입니다.
